jQuery(document).ready(function(){jQuery.getJSON("../src/data.json",function(i){$dataUrl=i.url,jQuery.ajax({url:$dataUrl,dataType:"application/json",complete:function(i){$carouselData=JSON.parse(i.responseText),list="",jQuery.each($carouselData.carouselData,function(i,e){list+='<li class="product-item"><div id="product-wrapper" class="product-wrapper"><div id="product-name"><a class="prod-name" title="'+e.name+'" href="'+e.url+'">'+e.name+'</a></div><div id="product-image-description-wrapper"><div id="product-image"><a class="prod-img" title="'+e.name+'" href="'+e.url+'"><img class="item-image" alt="'+e.productImageAltText+'" src="'+e.productImageUrl+'"></a></div><div id="product-description"><div id="row"><div class="manufacturerLogo"><img class="mLogo" title="'+e.distManufacturer.name+'" src="'+e.distManufacturer.brand_logo.url+'"/></div></div><div id="row"><div id="leftColumnlong" class="ellipsis leftColumnlong" title="Price per '+e.salesUnit+'">Price per '+e.salesUnit+'</div><div id="rightColumn"></div></div><div id="row"><div id="leftColumnPrice" class="ellipsis" title="Price"></div><div id="rightColumn" class="priceTeaserItem"><span class="currency">'+e.price.currency+"</span>"+e.price.formattedValue+'</div></div><div class="row buy-btn"><a class="btn btn-buy ellipsis" href="'+e.url+'">Buy now</a></div></div></div></div></li>'}),jQuery(".customer-also-buy-carousel").append(list),jQuery(".customer-also-buy-carousel li").length&&jQuery(".customer-also-buy-carousel").slick({infinite:!1,slidesToShow:4,slidesToScroll:1,vertical:!0,verticalSwiping:!0,responsive:[{breakpoint:600,settings:{slidesToShow:2}},{breakpoint:480,settings:{slidesToShow:1}}]})}})})});